import { click, EMPLOYEE_AUTORIZATION_SUCCESS } from './actionTypes';

export function getHaircut() {
  alert('it works!!!');
  return { type: click };
}

export function ClientsFeetchDataSuccess(clients) {
  return {
    type: 'CLIENTS_FETC_DATA_SUCCESS',
    payload: console.log(clients),
  };
}

export function ClientsFeetchData(url) {
  return (dispatch) => {
    fetch(url)
      .then((response) => {
        if (!response.ok) {
          throw new Error(response.statusText);
        }
        return response;
      })
      .then((response) => response.json())
      .then((clients) => dispatch(ClientsFeetchDataSuccess(clients)));
  };
}

export function EmployeeAutorization(email, password) {
  console.log('feetching starts...');
  const requestURL = `https://localhost:7275/Employee/GetToken?employeeEmail=${email}&password=${password}`;
  return (dispatch) => {
    fetch(requestURL, {
      method: 'post',
    })
      .then((response) => {
        if (!response.ok) {
          console.log(response.statusText);
          throw new Error(response.statusText);
        }
        return response;
      })
      .then(async (response) => {
        const data = await response.json();
        console.log(data);
        dispatch(EmployeeAutorizationSuccess(data));
      });
  };
}

export function EmployeeAutorizationSuccess(data) {
  console.log(data);
  return {
    type: EMPLOYEE_AUTORIZATION_SUCCESS,
    payload: data,
  };
}
